INSERT INTO `usos_frontpage_meme` VALUES (92,'Cóż, Jsos znów pojechał na wakacje. Mam nadzieję, że wróci z pamiątkami.'),(82,'Czy Jsos znów zrobił sobie przerwę? To jest student, który naprawdę zna swoje prawa.'),(56,'Czy wiesz, jak się nazywa strona, na której można znaleźć działający Jsos? - Miejsce, którego istnienia nie potwierdzono.'),(60,'Czy wiesz, jaki jest ulubiony sport Jsosa? - Ukrywanie się przed studentami w najważniejszych momentach.'),(68,'Czy wiesz, jakie są trzy najbardziej poszukiwane rzeczy na świecie? Skarb El Dorado, tajemnica Bermudów i działający Jsos.'),(72,'Czy wiesz, jakie są trzy najbardziej trudne do znalezienia obiekty w kosmosie? Czarne dziury, egzoplanety i działający Jsos.'),(21,'Dzisiaj JSOS jest tak wolny, że zaczynamy podejrzewać, że działa na prąd.'),(26,'Dzisiaj JSOS postanowił, że zrobi sobie dzień wolny od nas.'),(31,'Dzisiaj JSOS przypomina nam, że nie ma nic pewnego w życiu, oprócz niedziałającego JSOS-a.'),(84,'Gdzie jest Jsos, kiedy go potrzebujesz? Pewnie na wykładzie z niezawodności systemów.'),(76,'Jeśli Jsos miałby ocenę za niezawodność, myślę, że musiałby poprawiać egzamin.'),(94,'JSOS - jak strona z czasów przedhistorii, ale bez dinozaurów!'),(51,'Jsos - najlepsze ćwiczenie cierpliwości dla studentów od czasów odkrycia wszechświata.'),(45,'JSOS - strona, która działa szybciej niż ślimak na krzyżówce... #JSOS #slow'),(3,'JSOS - strona, która działa tylko wtedy, gdy jej nie potrzebujesz.'),(39,'JSOS - strona, która przypomina raczej vintage niż nowoczesność... #JSOS #vintagestyle'),(43,'JSOS - strona, na której wszyscy mają takie same pytania, ale nigdy nie znajdują odpowiedzi... #JSOS #pytania'),(102,'JSOS - tak blisko, a jednak tak daleko. Studenci, którzy go opanowali, zasługują na medal wytrwałości!'),(85,'Jsos chyba znowu ma wolne. Kto by pomyślał, że system też potrzebuje przerwy?'),(58,'Jsos działa tak rzadko, że postanowiłam go wziąć jako moje duchowe zwierzę mocy. Teraz też nic się nie dzieje.'),(15,'JSOS dzisiaj nauczył nas cierpliwości - czekając, aż się załaduje.'),(11,'JSOS dzisiaj oświadczył, że jest zajęty i nie ma czasu dla nas.'),(28,'JSOS dzisiaj postanowił, że nie będzie działał, abyśmy mogli spędzić czas na czytaniu ulubionej książki.'),(19,'JSOS dzisiaj postanowił, że to my potrzebujemy przerwy od niego.'),(30,'JSOS dzisiaj udowodnił, że zawsze jest coś, co może nas zaskoczyć - w tym przypadku, że nadal działa tak samo źle.'),(27,'JSOS dzisiaj udowodnił, że zawsze może być gorzej - zawsze może działać jeszcze wolniej.'),(25,'JSOS dzisiaj zaprosił nas do gry w \'Kto pierwszy odnajdzie kod błędu\' - ale nie jest to gra, której chcielibyśmy grać.'),(18,'JSOS dzisiaj zaprosił nas na nieplanowany dzień wolny - wygląda na to, że musimy skorzystać z tej okazji.'),(64,'Jsos i stabilność to jak woda i olej - zawsze się oddzielają.'),(69,'Jsos jest jak loteria - czekasz z podekscytowaniem na wynik, ale zazwyczaj kończysz z pustymi rękami.'),(100,'JSOS jest jak loteria - nigdy nie wiesz, czy trafisz na swoje oceny czy na białą stronę śmierci.'),(97,'JSOS jest jak magia - nie zawsze działa, ale gdy działa, to wszystko jest możliwe!'),(33,'JSOS jest jak moja była dziewczyna - nigdy nie działa tak, jak powinna... #JSOS #problematicznyserwis'),(61,'Jsos jest jak przyjaciel, który często znika, ale zawsze powraca, gdy najbardziej go potrzebujesz... albo nie.'),(52,'Jsos jest jak szczęśliwy los na loterii – wyjątkowo trudno go spotkać.'),(71,'Jsos jest jak teleport - raz przenosi cię do krainy informacji, a innym razem zostawia cię w czarnej dziurze braku dostępu.'),(65,'Jsos jest jak wakacyjny romans - pełen obietnic i podniecenia, ale szybko kończy się na wspomnieniach.'),(55,'Jsos jest jak złośliwy żartownik, który lubi zniknąć w najmniej odpowiednich momentach.'),(87,'Jsos jest niedostępny. Pewnie znów próbuje zrozumieć, jak działa plan zajęć.'),(91,'Jsos jest niedostępny... Czas na kawę, zanim on wróci do gry?'),(77,'Jsos jest teraz niedostępny... Być może zalicza poprawkę z funkcjonalności.'),(99,'JSOS ma dwie najważniejsze funkcje: przeglądanie ocen i trenowanie cierpliwości.'),(62,'Jsos ma jedno motto: \'Nigdy nie działa wtedy, gdy tego oczekujesz\'.'),(1,'JSOS ma jedno zadanie, a nawet to mu nie wychodzi.'),(80,'Jsos nie działa. Czy ktoś zapomniał powiedzieć mu, że sesja egzaminacyjna się skończyła?'),(93,'Jsos nie odpowiada. Prawdopodobnie jest zbyt zajęty sortowaniem swoich 1 i 0.'),(36,'JSOS to jak błąd w kodzie - nigdy nie wiesz, gdzie leży problem... #JSOS #debugging #programowanie'),(73,'Jsos to jak czekanie na swoje zamówienie w restauracji - masz nadzieję, że w końcu zostanie podane, ale czasami kelner udaje, że ciebie nie widzi.'),(49,'JSOS to jak czekanie na tramwaj w upalny dzień - wiecznie w kółko się kręci, ale nigdy nie przyjeżdża... #JSOS #tramwaj'),(67,'Jsos to jak koło fortuny - kręcisz, trzymasz kciuki i modlisz się, żeby zatrzymało się na działającej stronie.'),(7,'JSOS to jak kołowrotek - wciąż kręci się, ale nic się nie dzieje.'),(41,'JSOS to jak kopalnia złota - nigdy nie wiesz, czy trafisz na to, czego szukasz... #JSOS #kopaniaczegoszukanego'),(70,'Jsos to jak labirynt, w którym musisz znaleźć właściwą kombinację kliknięć, żeby dotrzeć do swojego celu - funkcjonującej strony.'),(75,'Jsos to jak łamigłówka dla umysłu - próbujesz znaleźć logikę w jego działaniu, ale w końcu dajesz się ponieść magii nieprzewidywalności.'),(5,'JSOS to jak loteria - nigdy nie wiesz, czy wygrasz dostęp do swoich ocen.'),(4,'JSOS to jak małżeństwo - raz działa, raz nie działa.'),(6,'JSOS to jak przyjaciel, który zawsze mówi, że będzie, ale nigdy nie pojawia się na czas.'),(57,'Jsos to jak stały bywalec imprezy - zawsze obiecuje, że się pojawi, ale rzadko się pojawia.'),(66,'Jsos to jak strona z zagadkami - nigdy nie wiesz, czy uda ci się rozwiązać zadanie, czy tylko stracisz czas czekając na jej odpowiedź.'),(48,'JSOS to jak strona, która działa tylko wtedy, gdy na niej nie jesteś... #JSOS #nieobecnosc'),(47,'JSOS to jak teoria spiskowa - nigdy nie wiesz, czy istnieje naprawdę, czy to tylko wymysł... #JSOS #teoriaspiskowa'),(54,'Jsos to jak wi-fi w dzikiej dżungli - pełen obietnic, ale często brak zasięgu.'),(35,'JSOS to miejsce, gdzie licznik ładowania strony jest bardziej nieprzewidywalny niż pogoda w Polsce... #JSOS #czaswladowywania'),(95,'JSOS to najbardziej tajemnicza część studenckiego doświadczenia. Nikt nie wie, kiedy się załaduje, ale wszyscy wiedzą, że to pewnego dnia się zdarzy!'),(63,'Jsos to prawdziwy magik - potrafi zniknąć z ekranu w mgnieniu oka, jakby nigdy nie istniał.'),(103,'JSOS to przykład perfekcyjnego balansu między frustracją a radością. Kiedy wreszcie się załaduje, to jak wygrana w loterii!'),(53,'Jsos to tajemnicza kula z przyszłości - nigdy nie wiesz, czy zadziała, dopóki na to nie zerkniesz.'),(101,'JSOS to tajemnicze laboratorium, w którym naukowcy badają ludzką wytrzymałość psychiczną poprzez testowanie cierpliwości studentów.'),(14,'JSOS to taka strona, co lubi nas zaskakiwać - zawsze wtedy, gdy się tego najmniej spodziewamy.'),(10,'JSOS to taka strona, co lubi urlopować.'),(96,'JSOS, czyli jak pokonać własne cierpliwości rekordy!'),(34,'JSOS, czyli miejsce, gdzie czas zawsze stoi w miejscu... #JSOS #notimeflieswhenusingjsos'),(2,'JSOS: Jedno z najbardziej niezawodnych narzędzi, jeśli chodzi o leżenie.'),(74,'Jsos: niezwykły artefakt, który potrafi łączyć się z internetem tylko w pełni księżycowej nocy.'),(98,'JSOS: Spróbuj załadować stronę, zrób sobie kawę, wróć i nadal czekaj.'),(59,'Jsos: zaprogramowany, aby działać na własnych zasadach i zaskakiwać wszystkich użytkowników.'),(38,'Kiedy czekasz na przypisanie punktów do przedmiotu, ale JSOS działa jak zwykle... #JSOS #oceny #punkty'),(50,'Kiedy Jsos działa, to tak rzadkie zjawisko, że zapisujemy je w księdze rekordów jako cud.'),(44,'Kiedy próbujesz przeglądać materiały na JSOS, ale strona ładuje się wolniejniż stare radioodbiorniki... #JSOS #lag'),(37,'Kiedy próbujesz się zalogować na JSOS, ale Twoja przeglądarka informuje Cię, że \'strona nie jest dostępna\'... #JSOS #polaczenienieudane'),(42,'Kiedy próbujesz się zalogować na JSOS, ale Twoja przeglądarka informuje Cię, że serwer jest niedostępny... #JSOS #niedostepnosc'),(32,'Kiedy próbujesz wejść na stronę JSOS, ale ona znowu nie działa... #JSOS #techniczneproblemy'),(46,'Kiedy próbujesz zdobyć informacje na JSOS, ale strona wyświetla Ci \'500 Internal Server Error\' - wygląda na to, że nawet serwer ma dosyć tej strony... #JSOS #internalservererror'),(40,'Kiedy w końcu udaje Ci się zalogować na JSOS, ale okazuje się, że wszystko jest w języku niemieckim... #JSOS #jezykniemiecki'),(90,'Kto powiedział, że komputery nie marzą? Jsos wygląda na to, że właśnie sobie drzemie.'),(79,'Nawet Jsos potrzebuje drzemki. Wróci do pracy, kiedy będzie gotowy... mamy nadzieję.'),(86,'Nie martw się, nie jesteś sam. Jsos też czasem leży i odpoczywa.'),(89,'Oops! Wygląda na to, że Jsos znów zapadł w sen zimowy.'),(88,'Prawdopodobnie Jsos chce, żebyśmy zaczęli doceniać jego obecność... poprzez brak obecności.'),(17,'Wszyscy wiedzą, że JSOS działa tylko wtedy, gdy masz wolne i nie chcesz nic robić.'),(12,'Wszyscy wiedzą, że kiedy JSOS działa, to jest to jak wygrana w loterii.'),(29,'Wydaje się, że dzisiaj JSOS jest na urlopie - w końcu też potrzebuje odpoczynku.'),(16,'Wydaje się, że JSOS postanowił odpocząć od nas dzisiaj - kto by mu to zabronił?'),(23,'Wygląda na to, że dzisiaj JSOS postanowił, że jest za słaby, aby działać.'),(9,'Wygląda na to, że dzisiaj JSOS też uznał, że potrzebuje wolnego dnia.'),(78,'Wygląda na to, że Jsos jest na długiej przerwie na lunch. Kto by pomyślał, że serwery również potrzebują posiłku?'),(83,'Wygląda na to, że Jsos miał dzisiaj \'pracę zdalną\'.'),(81,'Wygląda na to, że Jsos nie jest dostępny. Czas na przerwę od nauki?'),(20,'Zastanawialiście się kiedyś, co robi JSOS, kiedy nie działa? Ja też nie.'),(24,'Zastanawialiście się kiedyś, jakie są szanse na to, że JSOS będzie działał wtedy, gdy go potrzebujesz? Nie zbyt wysokie.'),(8,'Znów mamy imprezę na JSOS-ie - wszyscy czekamy, aż się załaduje.'),(22,'Znowu mamy okazję przetestować naszą cierpliwość, czekając, aż JSOS się załaduje.'),(13,'Znowu mamy szansę docenić, jak bardzo potrzebujemy JSOS-u w naszym życiu.');
